*/
import { template1, template2 } from "./contentTemplates/navigation/navigation_template/navigation"

export default {
    name: 'mainPage',
    title: 'Main Page',
    type: 'document',
    __experimental_actions: [/*'create',*/ 'update', /*'delete',*/ 'publish'],
    fieldsets: [
        {
            name: 'setNavMenu',
            title: 'Set Navigation Menu',
            type: 'string'        
