            description: 'How will people see the accounts for them to click.',
            options: {
                layout: 'radio',
                list: ['logo', 'link']
            } 
        }
    ],
    preview: {
        select: {
            title: 'socialMediaPlatform',
            account: 'socialMediaAccount'
        },
        prepare({title, account}) {
